import { Line } from 'react-chart-js-s';
import {
    Chart as ChartJS,
    LineElement,
    CategoryScale,
    LinearScale,
    PointElement
} from 'chart.js'

ChartJS.register(
    LineElement,
    CategoryScale,
    LinearScale,
    PointElement
)

function App() {
    const data = {
        labels: ['May 12', 'May 13', 'May 14'],
        datasets: [{
            data: [8, 7.8, 6],
            backgroundColor: 'transparent',
            borderColor: '#f26c6d'
        }]
    }

    const options = {};


    return (
        <div style={{width: '500px', height: '500px', marginLeft: '20px'}}>
            <Line data={data} options={options}></Line>
        </div>
    )

};
